                  justifyContent : 'center',
                  alignContent: 'center',
                  backgroundColor: '#fff',
                  padding : 10,
                  marginTop : 10,
                  fontSize : 18,
                  borderWidth: 1,
                  borderColor: "#ccc",
                  borderRadius : 10,
